                        "description":"\"Ya Mama's Favorite DJ\"\r\nIn the “Live Music Capital” 96.9 RnB's DJ DK is one of its elite spin-masters. Incorporating a finely tuned ear for rhythm and style into his mixes. DK plays all of the hottest current tracks mixed with the ever-popular classics and keeps the dance floor packed till dawn. After actively working the turntables of Austin for over 5 years, DJ DK’s popularity is still on the rise.\r\n\r\nDJ DK’s love of music didn’t stop him from pursuing an education. In fact, he deejayed his way through college becoming known to all of his classmates as the spin man about campus. It wasn’t long before he hit the major cities of Louisiana and started gaining attention from the local tastemakers and local celebrities and solidified his place in the Louisiana social scene.\r\n\r\nHis eccentric and outgoing personality shines through in his ear-satisfying beats. Pleasing any crowd can only be described as his proverbial sixth sense. With blends of Hip Hop , R&amp;B, Disco, Funk, and New Jack Swing, DJ DK maintains the unique ability to stay true to the roots of the dance floor with Funky Old School Classics. DK isn’t just all about the party, he also uses his talent for a good cause donating his time to March of Dimes and Hope Inc.\r\n\r\nMost recently DJ DK has been mixing his way across the country playing in Atlanta, Dallas, San Antonio, Shreveport, New Orleans, and his hometown, Jonesboro, LA. Club goers everywhere are falling in love with his sound. DJ DK can currently be seen in venues such as Top Golf Austin, Punch Bowl Social, Little Woodrows, Vinyl @ Chicago House, The Historic Red Scoot Inn, and The Geisha Room to name a few. His music is suitable for events ranging from corporate functions to charities, private affairs, and fashion shows.",
