                    "presented_by":"",
                    "title":"Happy Hour 3-6pm: $5 Micheladas, Sangria Margs, Draft Beers & More ",
                    "description":"<div><div><h1>Happy Hour Apps &amp; Drinks</h1><h2>FROM 3PM - 6PM MONDAY - SATURDAY</h2></div></div><div><div><div><h2>ALL DRINKS - $5</h2></div></div></div><div><div><h2>MICHELADA</h2><div><div><p>House made Michelada mix, fresh lime juice, and chili salt rim.</p></div></div></div></div><div><div><h2>SANGRIA MARGARITA</h2><div><div><p>Blend made with Rock Creek Cabernet, whiskey, and raspberry liquor, swirled with out frozen margarita.</p></div></div></div></div><div><div><h2>MICHELADA MARGARITA</h2><div><div><p>House tequila, triple sec, fresh squeezed lime juice, orange juice, cane sugar syrup, and a chili salt rim. On the rocks or frozen.</p></div></div></div></div><div><div><h2>SWIRL MARGARITA</h2><div><div><p>House tequila, triple sec, fresh squeezed lime juice, orange juice, cane syrup.</p><p>Frozen only. Flavors: Strawberry, Mango and Prickly Pear</p></div></div></div></div><div><div><h2>LIQUORS</h2><div><div><p>Dripping Springs Vodka</p><p>Deep Eddy Vodkas</p><p>Jose Cuervo Tequila</p><p>All Wells</p></div></div></div></div><div><div><h2>BEER</h2><div><div><p>All Drafts</p><div><div><div><h2>APPETIZERS</h2></div></div></div><div><div><div data-columns=\"3\"><div><div><h2>CHILI CON QUESO</h2><div><div><p>Our delicious Queso served with a spoonful of our seasoned ground beef.</p></div></div></div></div><div><div><h2>BOWL OF GUACAMOLE</h2><div><div><p>Fresh Guacamole topped with toasted Pepitas and Cotija.</p></div></div></div></div><div><div><h2>FRIED JALAPENOS</h2><div><div><p>Breaded fried jalapeños topped with chili con queso, crema and bacon bits.</p></div></div></div></div><div><div><h2>EMPANADAS</h2><div><div><p>Stuffed with Carnitas and served with habenero citrus salsa and crema.</p></div></div></div></div><div><div><h2>PUFFY TACOS</h2><div><div><p>Two ground beef tacos in a Puffy crispy shell or Two shredded chicken tacos in a chili infused Puffy crispy shell topped with lettuce, tomatoes, cheese and crema.</p></div></div></div></div><div><div><h2>MINI BURRITO SUPREME</h2><div><div><p>One mini burrito filled with refried beans, and mixed cheeses. Topped with queso, lettuce, diced tomatoes and crema.</p></div></div></div></div><div><div><h2>FLAUTAS AHOGADAS</h2><div><div><p>Mini Chicken Flautas covered with a chili broth. Topped with Crema and Cilantro.</p></div></div></div></div><div><div><h2>SHRIMP TOSTADA</h2><div><div><p>Mini Tostada chips with guacamole, Chipotle marinaded shrimp, topped with Crema and Cilantro.</p></div></div></div></div><div><div><h2>CHILI CHEESE FRIES</h2><div><div><p>Chili Con Carne, jalapenos, &amp; queso served on a bed of fries!</p></div></div></div></div></div></div></div></div></div></div></div>",
